import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import CarouselProjects from './projectsCarousel'
import { faGithub, faLinkedin } from '@fortawesome/free-brands-svg-icons';
import { faFilePdf, faTasks } from '@fortawesome/free-solid-svg-icons';
import Resume from '../../PDF/Dylan_M_Collins_Resume.pdf';
import Pros from "./projects3"


const LandingPage = () => {

    const [isOpen, setIsOpen] = useState(false);

    return (
        <div className='mainPage'>
            <h1 className='name'>Dylan Collins</h1>
            <h4>Full Stack Web Developer</h4>
            <nav className='nav'>
                <a target="_blank" href='https://www.linkedin.com/in/dylan-collins-bb226ba6/'><FontAwesomeIcon color='white' className='top-links' icon={faLinkedin} /></a>
                <a target="_blank" href='https://github.com/dylan17th'><FontAwesomeIcon color='white' className='top-links2' icon={faGithub} /></a>
                <a><FontAwesomeIcon onClick={() => setIsOpen(true)} color='white' className='top-links2' icon={faTasks} /></a>
            </nav>
            {/* <CarouselProjects setIsOpen={setIsOpen} isOpen={isOpen} /> */}
            <div style={{width:'100%', display:"flex", justifyContent: "center"}}>
                <Pros isOpen={isOpen}/>
            </div>
            <div className='div-resume'>
                <a className='resume' target="_blank" href={Resume}>Resume <FontAwesomeIcon color='white' icon={faFilePdf} /></a>
            </div>
        </ div>
    )
}

export default LandingPage;
